import React from 'react'

const ArticleListItem = (props) =>{
    const {
      title, 
      body, 
      onClick
    } = props
    return (
      <li>
        <h3>{title}</h3>
        <p>{body}</p>
        <button className='button' onClick={onClick}>Suprimer</button>
        <button className='button' >Modifier</button>
      </li>
    )
} 

export default ArticleListItem
